import { movies } from "../data/tvDummy";
import Movie from "../components/Movie/movie";

function TV() {
  return (
    <ul>
      {movies.results.map((movie) => (
        <li key={movie.id}>
          <Movie
            img={movie.backdrop_path}
            titleText={movie.title}
            voteAverage={movie.vote_average}
            movieId={movie.id}
          />
        </li>
      ))}
    </ul>
  );
}

export default TV;
